1. First, find the first derivative of \( f(x) = \sqrt{4x - x^2} \).

   Let \( u = 4x - x^2 \), so \( f(x) = \sqrt{u} \).

   The derivative of \( \sqrt{u} \) with respect to \( x \) is:
   \[
   f'(x) = \frac{1}{2\sqrt{u}} \cdot \frac{du}{dx}
   \]

   Now, find \( \frac{du}{dx} \):
   \[
   \frac{du}{dx} = 4 - 2x
   \]

   Therefore, the first derivative is:
   \[
   f'(x) = \frac{4 - 2x}{2\sqrt{4x - x^2}}
   \]

2. Next, find the second derivative \( f''(x) \).

   Differentiate \( f'(x) \) using the quotient rule:
   \[
   f'(x) = \frac{4 - 2x}{2\sqrt{4x - x^2}}
   \]

   Let \( v = 2\sqrt{4x - x^2} \) and \( w = 4 - 2x \).

   The quotient rule is:
   \[
   f''(x) = \frac{v \cdot \frac{dw}{dx} - w \cdot \frac{dv}{dx}}{v^2}
   \]

   Calculate \( \frac{dw}{dx} = -2 \).

   Calculate \( \frac{dv}{dx} \):
   \[
   v = 2\sqrt{4x - x^2} \Rightarrow \frac{dv}{dx} = \frac{2 \cdot (4 - 2x)}{2\sqrt{4x - x^2}} \cdot \frac{1}{2}
   \]

   Simplify:
   \[
   \frac{dv}{dx} = \frac{4 - 2x}{\sqrt{4x - x^2}}
   \]

   Substitute into the quotient rule:
   \[
   f''(x) = \frac{2\sqrt{4x - x^2} \cdot (-2) - (4 - 2x) \cdot \frac{4 - 2x}{\sqrt{4x - x^2}}}{(2\sqrt{4x - x^2})^2}
   \]

   Simplify:
   \[
   f''(x) = \frac{-4\sqrt{4x - x^2} - \frac{(4 - 2x)^2}{\sqrt{4x - x^2}}}{4(4x - x^2)}
   \]

   Simplify further:
   \[
   f''(x) = \frac{-4(4x - x^2) - (4 - 2x)^2}{4(4x - x^2)^{3/2}}
   \]

3. Evaluate \( f'(x) \) and \( f''(x) \) at \( x = 2 \).

   At \( x = 2 \):
   \[
   f'(2) = \frac{4 - 2 \cdot 2}{2\sqrt{4 \cdot 2 - 2^2}} = \frac{0}{2\sqrt{4}} = 0
   \]

   \[
   f''(2) = \frac{-4(4 \cdot 2 - 2^2) - (4 - 2 \cdot 2)^2}{4(4 \cdot 2 - 2^2)^{3/2}}
   \]

   Simplify:
   \[
   f''(2) = \frac{-4(8 - 4) - 0}{4 \cdot 8^{3/2}}
   \]

   \[
   f''(2) = \frac{-16}{4 \cdot 8\sqrt{8}}
   \]

   \[
   f''(2) = \frac{-16}{32\sqrt{8}}
   \]

   \[
   f''(2) = \frac{-1}{2\sqrt{8}}
   \]

4. Calculate the curvature \( \kappa \) at \( x = 2 \).

   The formula for curvature is:
   \[
   \kappa = \frac{|f''(x)|}{(1 + (f'(x))^2)^{3/2}}
   \]

   At \( x = 2 \):
